%pig.query
set1 = GROUP diabetes by (age);
FOREACH set1 GENERATE FLATTEN(group) as (age), COUNT($1);

%pig.query
set1 = Group diabetes All;
foreach set1  Generate (diabetes.age), AVG(diabetes.BMI), AVG(diabetes.skinThickness), AVG(diabetes.Insulin);

%pig.query
set1 = GROUP diabetes BY age;
set2 = FOREACH set1 GENERATE FLATTEN(group) as (age), AVG(diabetes.outcome) AS outcome;
ORDER set2 BY outcome DESC;
